import React from 'react'
import './Home.css'
import '../../assets/images/bank6.jpg'
import { useNavigate } from 'react-router-dom';
import Button from 'react-bootstrap/Button';

const Home = () => {
  const navigate = useNavigate();
const submit = async()=>{
    navigate('/login')
}
  return (
    <div>
        <section className="header">
        <div className="text-box" >
            <h1>BHARATH BANK</h1>
            <h3>Empowering Your Financial Journey</h3><br/>
        <Button variant="outline-success" size='lg' className="hero-btn" onClick={submit} >Get Started</Button>
        </div>
       </section>

    <section className="footer">
        <h1>About Us</h1>
        <p>At Bharath bank, we believe in the power of financial well-being and the positive impact it can have on individuals, families, and communities. As a trusted financial institution, we are committed to providing innovative solutions and personalized services that empower our customers to achieve their financial goals</p>
        <h3>Our History</h3>
        <p>Established in 1990, Bharatj bank has a rich history rooted in a commitment to integrity, reliability, and community support. Over the years, we have evolved to meet the changing needs of our customers while staying true to our core values</p>
    </section>
    </div>
  )
}

export default Home
